import ResponsiveMenu from 'react-responsive-navbar';
import { Button, Box, Flex } from '@chakra-ui/core';
import { RiMenuLine } from 'react-icons/ri';
const Navbar = (props) => {
  return (
    <ResponsiveMenu
      menuOpenButton={
        <Flex
          pl='20px'
          pr='20px'
          justifyContent='space-between'
          alignItems='center'
        >
          LOGO
          <Box as={RiMenuLine} />
        </Flex>
      }
      menuCloseButton={<div>Cerrar</div>}
      changeMenuOn='500px'
      largeMenuClassName='large-menu-classname'
      smallMenuClassName='small-menu-classname'
      menu={
        <div>
          <div className='item logo'>
            Logo
            <div className='opts'>
              <div>Cursos Presenciales</div>
              <div>Nostros</div>
              <div>Crewsoft</div>
              <div>Crewdemy live</div>
            </div>
          </div>

          <div className='button'>
            <Button className='button' variantColor='teal'>
              Ingresar
            </Button>
          </div>
        </div>
      }
    />
  );
};
export default Navbar;
